import React, {useState, useEffect} from 'react';
import './App.css';
import '@picocss/pico'


function App() {

  let [weaponImage, setWeaponImage] = useState(null);

  useEffect(() => {
    fetch("http://csgobackpack.net/api/GetItemsList/v2/")
    .then(response => response.json())
    .then(data => setWeaponImage(data.message))
  }, [])

  return (
    <div>
      {weaponImage && <img src={weaponImage}></img>}
    </div>
  );
}

export default App;
